import React, { useEffect } from 'react'
import axios from 'axios';
import { useParams } from 'react-router-dom';


export const View = () => {

    const { id } = useParams();


    useEffect(() => {
        axios.get('http://localhost:8000/api/pirates/' + id)
            .then(res => {
                console.log(res.data)
            })
            .catch(err => console.log(err))
    })

    return (
        <div>View</div>
    )
}

export default View;
